--[[
	The object streamer!
]]
local g_iLoaded  = 1 -- lua table starts at 1
local g_iObjects = tonumber ( #g_tObjects )
local g_pTimer   = nil

addEvent ( "onClientDoneDownloading", true )
addEventHandler ( "onClientDoneDownloading", localPlayer,
	function ( )
		fadeCamera ( false )
		addEventHandler ( "onClientRender", root, renderLoadingScreen )
		g_pTimer = setTimer ( loadPartsOfObjects, 600, 0 )
	end
)


function loadPartsOfObjects ( )
	for i = g_iLoaded, g_iLoaded + math.random ( 500, 600 ) do
		local objData = g_tObjects [ i ]
		
		-- Done ?
		if not objData and g_pTimer then
			removeEventHandler ( "onClientRender", root, renderLoadingScreen )
			fadeCamera ( true )
			
			if g_pTimer then killTimer ( g_pTimer ) g_pTimer = nil end
			
			setTimer ( setElementPosition, 5500, 1, localPlayer, 0, 0, 17 )

			return -- YES!
		end
		
		-- inc
		g_iLoaded = g_iLoaded + 1
		
		-- Load object
		local iModel, fX, fY, fZ, fRotX, fRotY, fRotZ, fRotW, iInterior, iLOD = objData[1], objData[2], objData[3], objData[4], objData[5], objData[6], objData[7], objData[8], objData[9], objData[10]
		createObject ( iModel, fX, fY, fZ, fRotX, fRotY, fRotZ, fRotW, iInterior, iLOD )
	end
end

-- Loading screen
local screenWidth, screenHeight = guiGetScreenSize ( )
function renderLoadingScreen ( )
	-- Draw a black screen.
	dxDrawRectangle ( 0, 0, screenWidth, screenHeight, tocolor ( 0, 0, 0, 255 ) )
	
	-- Progress bar
	local y = ( screenHeight / 2 ) - 20
	local u = ( ( g_iLoaded / g_iObjects ) * 100 ) -- 0 to 100
	local p = ( screenWidth / 100 ) * u
	dxDrawRectangle ( 0, y, p, 40, tocolor ( 255, 255, 255, 255 ) )
	
	-- Text
	local sString = "Loading " .. tostring ( g_iLoaded ) .. "/" .. tostring ( g_iObjects ) .. " (" .. tostring ( math.floor ( u ) ) .. "%)..."
	local textX   = ( screenWidth / 2 ) - ( dxGetTextWidth ( sString, 1, "verdana" ) / 2 )
	
	dxDrawText ( sString, textX, y - 20, screenWidth, screenHeight, tocolor ( 255, 255, 255, 255 ), 1, "verdana" )
end


--[[
	createObject function
]]
_createObject = createObject
function createObject ( iModel, fX, fY, fZ, fRotX, fRotY, fRotZ, fRotW, iInterior, iLOD )
	if iModel == 901 then
		return -- no rocks on the streets pls
	end
	
	if iModel == 1296 then
		return -- fail barrier at hospital
	end
	
	if iModel == 1306 then
		return
	end
	
	-- No seabeds please
	--[[if string.sub ( tostring ( iModel ), 0, 3 ) == "bed" then
		return
	end]]
	
	local quat = quaternionToEuler ( {["x"] = fRotX, ["y"] = fRotY, ["z"] = fRotZ, ["w"] = fRotW}, iModel )
	local newX, newY, newZ = quat["x"], quat["y"], quat["z"]
	local pObject          = _createObject ( iModel, fX, fY, fZ - 5, 0, 0, 0 )
	--local pLODObject       = _createObject ( iModel, fX, fY, fZ - 5, 0, 0, 0, true )

	if pObject then
		setElementFrozen ( pObject, true )
		setElementDoubleSided ( pObject, true )
		setObjectBreakable ( pObject, false )
		engineSetModelLODDistance ( iModel, 300 ) -- 170 for slow pc, 300 is max
		
		setElementRotation ( pObject, newX, newY, -newZ)--, "ZXY" )
		
		-- LOD object
		--if pLODObject then
		--	setLowLODElement ( pObject, pLODObject )
		--	setElementRotation ( pLODObject, newX, newY, -newZ)--, "ZXY" )
		--end
		
		-- Make the object invisible and collisionless (our streamer handles it)
		--setElementCollisionsEnabled ( pObject, false )
		--setElementAlpha ( pObject, 0 )
	else
		-- object invalid!
		outputChatBox ( tostring ( iModel ) )
	end
end


--[[
	Taken from: http://www.darwin3d.com/gamedev/quat2eul.cpp
	
	-
	(x86) TODO: MTA now supports setElementMatrix.
	-
]]
M_PI = 3.14159265
function quaternionToEuler( q, iModel )
--/// Local Variables ///////////////////////////////////////////////////////////
	local matrix = {};
	matrix[0] = {};
	matrix[1] = {};
	matrix[2] = {};

	local cx,sx,x;
	local cy,sy,y,yr;
	local cz,sz,z;
--///////////////////////////////////////////////////////////////////////////////
	-- CONVERT QUATERNION TO MATRIX - I DON'T REALLY NEED ALL OF IT
	matrix[0][0] = 1.0 - (2.0 * q["y"] * q["y"]) - (2.0 * q["z"] * q["z"]);
--	matrix[0][1] = (2.0f * q["x"] * q["y"]) - (2.0f * q["w"] * q["z"]);
--	matrix[0][2] = (2.0f * q["x"] * q["z"]) + (2.0f * q["w"] * q["y"]);
	matrix[1][0] = (2.0 * q["x"] * q["y"]) + (2.0 * q["w"] * q["z"]);
--	matrix[1][1] = 1.0f - (2.0f * q["x"] * q["x"]) - (2.0f * q["z"] * q["z"]);
--	matrix[1][2] = (2.0f * q["y"] * q["z"]) - (2.0f * q["w"] * q["x"]);
	matrix[2][0] = (2.0 * q["x"] * q["z"]) - (2.0 * q["w"] * q["y"]);
	matrix[2][1] = (2.0 * q["y"] * q["z"]) + (2.0 * q["w"] * q["x"]);
	matrix[2][2] = 1.0 - (2.0 * q["x"] * q["x"]) - (2.0 * q["y"] * q["y"]);

	local sy = -matrix[2][0];
	local cy = math.sqrt(1 - (sy * sy));
	local yr = math.atan2(sy,cy);
	
	local euler = {};
	euler['y'] = (yr * 180.0) / M_PI;

	-- AVOID DIVIDE BY ZERO ERROR ONLY WHERE Y= +-90 or +-270 
	-- NOT CHECKING cy BECAUSE OF PRECISION ERRORS
	if (sy ~= 1.0 and sy ~= -1.0) then
		cx = matrix[2][2] / cy;
		sx = matrix[2][1] / cy;
		euler['x'] = (math.atan2(sx,cx) * 180.0) / M_PI;	-- RAD TO DEG

		cz = matrix[0][0] / cy;
		sz = matrix[1][0] / cy;
		euler['z'] = (math.atan2(sz,cz) * 180.0) / M_PI;	-- RAD TO DEG
	else
		-- SINCE Cos(Y) IS 0, I AM SCREWED.  ADOPT THE STANDARD Z = 0
		-- I THINK THERE IS A WAY TO FIX THIS BUT I AM NOT SURE.  EULERS SUCK
		-- NEED SOME MORE OF THE MATRIX TERMS NOW
		matrix[1][1] = 1.0 - (2.0 * q["x"] * q["x"]) - (2.0 * q["z"] * q["z"]);
		matrix[1][2] = (2.0 * q["y"] * q["z"]) - (2.0 * q["w"] * q["x"]);
		cx = matrix[1][1];
		sx = -matrix[1][2];
		euler['x'] = (math.atan2(sx,cx) * 180.0) / M_PI;	-- RAD TO DEG

		cz = 1.0;
		sz = 0.0;
		euler['z'] = (math.atan2(sz,cz) * 180.0) / M_PI;	-- RAD TO DEG
	end
	
	return euler
end
